import React, {Component} from 'react';
import {Grid, Cell, Footer, FooterSection, FooterLinkList} from 'react-mdl';
import TypeOut from 'react-typeout';

const words = ['programming', 'outdoors', 'creating small ventures', 'learning from failure'];

var ReactRotatingText = require('react-rotating-text');



class Landing extends Component {
  render(){
    return(
      <div>
      <h2>Hello! my name is Harris Schrick.<br/>
          I am a computer science student at Kansas State University in the college of Engineering.<br/>
          Some passions of mine are <ReactRotatingText items={['programming.', 'the great outdoors.', 'creating small ventures.','reading documents.', 'learning from failure.']} /><br/>
          This website is a place for me to update about work that I am doing inside and outside of class.<br/>
          Feel free to look around and contact me at any time I will reply within one hour!</h2>

          <div className="contact-body">
        <Grid className="contact-grid">
          <Cell col={6}>
            <h2>Harris Schrick</h2>
            <img
              src="https://i.imgur.com/1obxL8y.png"
              alt="avt"
              className="avatar-img"
            />
            <p>Feel free to contact me anytime! I am available 24/7, and will reply or call back within 4 hours of contact.</p>
          </Cell>
          <Cell col={6}>
          <h2><br/>Phone: <br/>770-363-9450</h2>
          <h2>Email: Schrickharris@gmail.com</h2>
          <h2>Skype: live:d099a75218e96f52</h2>
          </Cell>
        </Grid>
      </div>




          <div className="links">
          </div>
          </div>

    )
  }
}

export default Landing;
